import React, { useState } from "react";
import { Grid, Button, TextField, Card, CardContent } from "@mui/material";

export const Home = () => {
  const [task, setTask] = useState(new Date());
  return (
    <Card>
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField variant="outlined" fullWidth label="ENTER Nmae" />
          </Grid>
          <Grid item xs={6}>
            <Button variant="contained" fullWidth color="success">
              {task}
            </Button>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};
